import React from 'react'

//Css
import { CssBaseline, IconButton, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { Header } from "./components/header";
import background from "./img/background.jpg";
import SouthIcon from '@mui/icons-material/South';


export const App = () => {
  return (
    <Box sx={{
      display: "flex", 
      justifyContent: "center", 
      alignItems: "center",
      backgroundImage: `url(${process.env.PUBLIC_URL+background})`,
      minHeight: "100vh",
      backgroundRepeat: "no-repeat",
      backgroundSize: "cover"
    }}>
      <CssBaseline/>
      <Header/>
      <Box sx={{
        display: "flex",
        directionFlex: "column",
        al: "center"
      }}>
        <Typography variant='h1' sx={{
          fontSize: "2.5rem", 
          fontWeight: "bold",
          color: "#fff",
          textAlign:"center"
          }}
          >Welcome to <br/> My Island
        </Typography>

        <IconButton
                size="large"
                edge="start"
                color="inherit"
                aria-label="menu"
                sx={{ mr: 2 }}
            >
                <SouthIcon sx={{fontSize:"2.5rem",color:"#fff"}}/>
            </IconButton>
      </Box>
    </Box>
  );
}
